@font-face {
    font-family: roboto;
    src: url('70d9ef85b6126a53f0f50dcddc1ca484.ttf');

}

@font-face {
    font-family: economica;
    src: url('99a625ea635a28cce04e8e494b753017.ttf');
}

body {
    text-align: center;
    font-size: 20px;
    padding: 2.5%;
    font-family: roboto;
}

.button {
    font-size: 15px;
}

h1,h2,h3,h4,h5 {
    font-family: economica;
}   

.header {
    display: inline-block;
    margin: 20px;
    margin-bottom: 50px;
}

.artist-image {
    width: 300px;
    height: 300px;
    border-radius: 150px;   
    margin-top: 30px;
}

.track {
    position: relative;
    display: inline-block;
    margin: 30px;
    width: 300px;
    height: 300px;
    cursor: pointer;
}

.track-image {
    width: 200px;
    height: 200px;
    margin: 5px;
}

.track-icon {
    position: absolute;
    top: 75px;
    left: 123px;
    color: white;
    background-color: black;
    width: 50px;
    height: 50px;
    border-radius: 25px;
    padding: 13px;
    opacity: 0.8;
}
